function newsInit(){var n=parseInt(window.location.href.split("/")[window.location.href.split("/").indexOf("profile")+1],10);$.get(`/api/profile/${n}/news`,n=>{n=n.newsList;const d=$("#newsContainer");n.forEach(function(n){var e=n[1],t=n[0].date,n=n[0].text,a=$("<div>").addClass("newsBlock");a.append($("<div>").text(e).addClass("name")),a.append($("<div>").text(t).addClass("date")),a.append($("<p>").text(n).addClass("content")),d.append(a)})})}newsInit();